        </div>
        <div className="small">
          <span className="me-3">Desarrollado por <span className="fw-semibold">Anahí Adamaco, Pamela y Rodrigo</span></span>
          <a href="mailto:soporte@gestoreventos.com" className="text-light text-decoration-underline me-2">Contacto</a>
          <a href="#" className="text-light text-decoration-underline">Política de privacidad</a>
        </div>
      </div>
    </footer>
  );
};

